import './App.css'
import { BrowserRouter, Route, Routes } from "react-router-dom"
import Dashboard from './pages/Dashboard/Dashboard';

function App() {

  return <BrowserRouter>
    <Routes>
      <Route path="/" element={<Dashboard />} />
      {/* <Route path="/orders" element={} /> */}
    </Routes>
  </BrowserRouter>
}

export default App;
